window.bookSummaryJSON = "Lieutenant Commander Matthew Reddy, along with the men and women of the U.S.S. <i>Walker</i>, are once again at war. Having sided with the peaceful Lemurians against the savage, reptilian Grik, they now find themselves scrambling to prepare for the attack that is sure to come, searching for resources to support their forces - even as they look for allies to join their struggle. <p>Meanwhile, the Japanese juggernaut Amagi, also trapped in this strange world, is under Grik control---with her fanatical commander approaching madness. And soon they will have amassed a force that no amount of firepower and technology will be able to stop.As the raging conflict approaches, Reddy, his crew, his allies, and his loved ones face annihilation. But if there is one thing they have learned about their new world, it is that hope - and help - may be just over the horizon.</p>"; 
